document.addEventListener('alpine:init', () => {
	Alpine.store('app', {
		data: Alpine.$persist([]),
		priceForList: ['  100 ', '  1 ', '  50 ', '  1 .', '  1 .', '  2 .', '  3 .', '  4 .', '  5 .', '  10 .', '   ', '-   '],
		colorsList: ['', '', ''],
		layoutList: ['', ' ', '  ()', '  ()'],
		objStyleCell: Alpine.$persist({}),
		objCommentsCell: Alpine.$persist({}),
	});

	const regPlu = /^\d{1,6}$/;

	Alpine.store('app').sheet = jspreadsheet(document.getElementById('spreadsheet'), {
		data: Alpine.store('app').data,
		minDimensions: [5, 10],
		columns: [
			{ type: 'text', title: '', width: 250, align: 'left' },
			{ type: 'text', title: 'PLU', width: 100 },
			{ type: 'dropdown', title: ' ', width: 120, align: 'left', source: Alpine.store('app').priceForList },
			{ type: 'dropdown', title: ' ', width: 120, source: Alpine.store('app').colorsList },
			{ type: 'dropdown', title: '', width: 200, source: Alpine.store('app').layoutList },
		],
		columnSorting: false,
		allowInsertRow: true,
		allowInsertColumn: false,
		rowResize: false,
		columnResize: true,
		rowDrag: false,
		allowDeleteRow: true,
		allowDeleteColumn: false,
		allowRenameColumn: false,
		allowComments: false,
		defaultColWidth: 100,
		text: {
			noRecordsFound: '  ',
			showingPage: '  {0}  {1} ',
			show: '',
			entries: '',
			insertANewColumnBefore: '    ',
			insertANewColumnAfter: '    ',
			deleteSelectedColumns: '  ',
			renameThisColumn: '  ',
			orderAscending: '  ',
			orderDescending: '  ',
			insertANewRowBefore: '    ',
			insertANewRowAfter: '   ',
			deleteSelectedRows: '  ',
			editComments: ' ',
			addComments: ' ',
			comments: '',
			clearComments: ' ',
			copy: ' ...',
			paste: ' ...',
			saveAs: '  ...',
			about: ' ',
			areYouSureToDeleteTheSelectedRows: '  -   ?',
			areYouSureToDeleteTheSelectedColumns: '  -   ?',
			thisActionWillDestroyAnyExistingMergedCellsAreYouSure: '      .  ?',
			thisActionWillClearYourSearchResultsAreYouSure: '    .  ?',
			thereIsAConflictWithAnotherMergedCell: '     ',
			invalidMergeProperties: '  ',
			cellAlreadyMerged: '  ',
			noCellsSelected: '   ',
		},
		onload: function (instance) {
			const objCommentsCell = Alpine.store('app').objCommentsCell;
			for (let key in objCommentsCell) {
				this.setComments(key, objCommentsCell[key]);
			}
		},
		onchange: function (instance, cell, x, y, value) {

			let strExcelCoords = jexcel.getColumnNameFromId([x, y]);

			let updatedValue = value.toString().trim();

			if (updatedValue.length) {

				if (x == 0) {
					updatedValue = updatedValue.toUpperCase();
				}

				if (x == 1) {
					if (regPlu.test(updatedValue)) {
						this.setComments(strExcelCoords, ``);
						cell.style.backgroundColor = ``;
					} else {
						this.setComments(strExcelCoords, `PLU   ,       !`);
						cell.style.backgroundColor = `#ffd1d1`;
					}
				}

				if (x == 2) {
					let numPriceForId = Alpine.store('app').priceForList.indexOf(value);
					if (numPriceForId < 0) {
						this.setComments(strExcelCoords, `" "       !`);
						cell.style.backgroundColor = `#ffd1d1`;
					} else {
						this.setComments(strExcelCoords, ``);
						cell.style.backgroundColor = ``;
					}
				}

				if (x == 3) {
					let numColorsListId = Alpine.store('app').colorsList.indexOf(value);
					if (numColorsListId < 0) {
						this.setComments(strExcelCoords, `        !`);
						cell.style.backgroundColor = `#ffd1d1`;
					} else {
						this.setComments(strExcelCoords, ``);
						cell.style.backgroundColor = ``;
					}
				}

				if (x == 4) {
					let numLayoutListId = Alpine.store('app').layoutList.indexOf(value);
					if (numLayoutListId < 0) {
						this.setComments(strExcelCoords, `        !`);
						cell.style.backgroundColor = `#ffd1d1`;
					} else {
						this.setComments(strExcelCoords, ``);
						cell.style.backgroundColor = ``;
					}
				}
			} else {

				this.setComments(strExcelCoords, ``);
				cell.style.backgroundColor = ``;
			}

			if (value !== updatedValue) this.setValue(strExcelCoords, updatedValue, false);

			Alpine.store('app').objStyleCell = this.getStyle();
			Alpine.store('app').objCommentsCell = this.getComments();
		},
		onbeforepaste: () => {
		},
		onpaste: () => {
		},
		style: Alpine.store('app').objStyleCell,
	});
});

function mm(number) {
	return number * 2.83465;
}

function wrapText(strWholeLine, numMaxWidth, objFont, numFontSize) {
	const arrWordsBreak = strWholeLine.split('\\');
	let strLineResult = ``;
	const arrResult = [];
	for (const strLine of arrWordsBreak) {
		const arrWords = strLine.split(' ');
		for (const strWord of arrWords) {
			let strLineTest = strLineResult + strWord + ' ';
			const numWidthTest = objFont.widthOfTextAtSize(strLineTest, numFontSize);
			if (numWidthTest > numMaxWidth) {
				arrResult.push(strLineResult);
				strLineResult = strWord + ' ';
			} else {
				strLineResult = strLineTest;
			}
		}
		arrResult.push(strLineResult);
		strLineResult = ``;
	}
	arrResult.push(strLineResult);
	return arrResult;
}
